import React, { useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { updateFeature } from '../store/wktSlice';

export const EditFeature = ({ id, name, wkt, userId, onClose }) => {
  const [localName, setLocalName] = useState(name);
  const [localUserId, setLocalUserId] = useState(userId);
  const [localWkt, setLocalWkt] = useState(wkt);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const dispatch = useDispatch();
  const isAdmin = useSelector((state) => state.admin.isAdmin);
  const geometry = localWkt.split("(")[0].trim();

  const handleSave = async (userId) => {

    const userIdToSend = localUserId ? Number(localUserId) : null;

    if (userIdToSend == null || !localName.trim()) {
      setError("Required fields can not be empty.");
      return;
    }

    try {
      setLoading(true);
      setError(null);
      const token = localStorage.getItem("token");

      const response = await fetch(`https://localhost:7014/api/Logs/${id}`, {
        method: 'PUT',
        headers: {
          Authorization: `Bearer ${token}`,
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          id: id,
          name: localName,
          log: localWkt,
          UserId: userIdToSend,
        }),
      });

      if (!response.ok) {
        throw new Error('Failed to update feature');
      }

      const data = await response.json();

      if (!data.result) {
        throw new Error(data.message || 'Failed to update feature');
      }

      dispatch(updateFeature(data.value));
      onClose();
      alert('Feature updated successfully!');
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="fixed inset-0 flex items-center justify-center bg-gray-500 bg-opacity-75">
  <div className="bg-white rounded-lg px-4 pt-5 pb-4 text-left overflow-hidden shadow-xl transform transition-all sm:max-w-lg sm:w-full sm:p-6">
    <div className="sm:flex sm:items-start">
      <div className="mx-auto flex-shrink-0 flex items-center justify-center h-12 w-12 rounded-full bg-blue-100 sm:mx-0 sm:h-10 sm:w-10">
        <svg className="h-6 w-6 text-blue-600" fill="none" stroke="currentColor" strokeWidth="2" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
          <path strokeLinecap="round" strokeLinejoin="round" d="M16.862 3.487a2.5 2.5 0 0 1 3.535 3.535L9 18.414 4 19l.586-5L16.862 3.487Z" />
        </svg>
      </div>
      <div className="mt-3 text-center sm:mt-0 sm:ml-4 sm:text-left">
        <h3 className="text-lg leading-6 font-medium text-gray-900">Edit Feature</h3>
        <div className="mt-2">
          <label className="block text-sm font-medium text-gray-700">Name</label>
          <input
            type="text"
            value={localName}
            onChange={(e) => setLocalName(e.target.value)}
            className="mt-1 px-3 py-2 block w-full shadow-sm border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500 sm:text-sm"
          />
        </div>
        {isAdmin && (
          <div className="mt-2">
            <label className="block text-sm font-medium text-gray-700">User Id</label>
            <input
              type="number"
              value={localUserId}
              onChange={(e) => setLocalUserId(e.target.value)}
              className="mt-1 px-3 py-2 block w-full shadow-sm border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500 sm:text-sm"
            />
          </div>
        )}
        <div className="mt-2">
          <p className="text-sm leading-5 text-gray-500"><strong>Type:</strong> {geometry}</p>
        </div>
        {error && <p className="text-red-500 text-sm mt-2">{error}</p>}
      </div>
    </div>
    <div className="mt-5 sm:mt-4 sm:flex sm:flex-row-reverse">
      <button onClick={() => handleSave(localUserId)} disabled={loading} className="inline-flex justify-center w-full rounded-md border border-transparent px-4 py-2 bg-blue-600 text-base leading-6 font-medium text-white shadow-sm hover:bg-blue-500 focus:outline-none focus:shadow-outline-blue transition ease-in-out duration-150 sm:w-auto">
        {loading ? 'Saving...' : 'Save'}
      </button>
      <button onClick={onClose} className="mt-3 inline-flex justify-center w-full rounded-md border border-gray-300 px-4 py-2 bg-white text-base leading-6 font-medium text-gray-700 shadow-sm hover:text-gray-500 focus:outline-none focus:border-blue-300 focus:shadow-outline-blue transition ease-in-out duration-150 sm:mt-0 sm:w-auto">
        Cancel
      </button>
    </div>
  </div>
</div>

  );
};

export default EditFeature;
